import React, { useState } from 'react';

// import children components
import TiktokOrgPost from './TiktokOrgPost';

//import database
import { tiktok_info } from "../data/tiktok";


const Tiktok = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className='tiktok-wrapper'>
        <h1>TikTok</h1>

        <section>

            <h2>TikTok Organizer</h2>

            <button onClick={() => setIsOpen(!isOpen)}>Toggle Post</button>

            {isOpen && tiktok_info.map((item, index) => {
              return <TiktokOrgPost title={item.title} audio={item.audio} script={item.script} key={index}/>;
            })}

        </section>

        <section>
            <h2>TikTok Visualizer</h2>
        </section>

    </div>
  )
}

export default Tiktok;
